  false,\n\t\"url\": null,\n\t\"notes\": \"This Annual Narrative Report for Malheur
  National Wildlife Refuge summarizes refuge activities during 1977.  The report begins
  with information about the climatic conditions in 1977, land that was acquisitioned
  during the year, and the system status.   Construction and maintenance activities
  are also covered.  The report includes a habitat management section which discusses
  croplands, grasslands, wetlands, forest lands, other habitats, and special areas.
  \ Wildlife is outlined with focus on endangered/threatened species, migratory birds,
  non-migratory birds, and mammals.  Interpretation and recreation are also covered;
  law enforcement is described in this section.  Finally, information is provided
  about field investigations, cooperative programs, items of interest, and safety.\",\n\t\"license_title\":
